    false,nt"url": null,nt"notes": "Digital surfaces and thicknesses of selected
    hydrogeologic units of the Floridan aquifer system were developed to define an updated
    hydrogeologic framework as part of the U.S. Geological Survey Groundwater Resources
    Program. This map layer shows areal and linear water features of Florida, Georgia,
    South Carolina, and Alabama. The original file was produced by joining the individual
    State hydrography layers from the 1:2,000,000- scale Digital Line Graph (DLG) data
    produced by the USGS. This map layer was formerly distributed as Hydrography Features
    of the United States. This is a revised version of the January 2003 map layer.",nt"owner_org":
